    componentDidMount(){
        const { endpoint } = this.state;
        const socket = socketIOClient(endpoint);
        socket.on("connect", (socket) => { console.log("con") });
        console.log(localStorage.getItem("IP"))
        socket.emit("messeage", localStorage.getItem("IP"))
    }

    sendHandler(socket){
        socket.emit("messeage", localStorage.getItem("IP"))

    }

    render() {


        return(
            <div>

                <div>

                    <h1>Мои сообщения</h1>
